import Header from "./Header";

const layoutStyle = {
  maxWidth: "1280px",
  margin: "auto",
  padding: "20px",
};

const Layout = (props) => (
  <div style={layoutStyle} className='margin-auto'>
    <Header />
    {props.children}
  </div>
);

export default Layout;
